#define VGAADDR_BITCHAR     0xbfe03020
#define VGAADDR_DISABLE     0xbfe03024

#define CONSOLE_WIDTH      127
#define CONSOLE_HEIGHT     46
#define DEFAULT_COLOR   0x70
#define ui unsigned int


int text_x,text_y;	//光标位置，x是列号，y是行号
unsigned short buf_ch[CONSOLE_HEIGHT][CONSOLE_WIDTH + 1];
unsigned char buf_color[CONSOLE_HEIGHT][CONSOLE_WIDTH + 1];

static void vga_putchar_ascii(char ch,int y,int x,unsigned char color){
    color &= 0x7F;
    OUT32(y | (x << 8),VGAADDR_CHARPOS);
    OUT32(ch | ((int)color << 16),VGAADDR_CHAR);
}

static void vga_setcursor(int y,int x){    //光标启用显示并设置位置
    OUT32(y | (x << 8),VGAADDR_CURPOS);
}

static void vga_setmode(int mode){ //mode=0: 文本模式，mode=1：图像模式
    OUT32(mode,VGAADDR_MODE);
}

unsigned char* uni_font=(unsigned char*)font_data;

static void vga_putchar_unicode(unsigned short uni_ch,int y,int x,unsigned char color){
    //保证x后一定至少有两格空隙
    unsigned int* ptr=(unsigned int*)(uni_font + (((int)(uni_ch & 0xFfff)) << 5));
    int i;

    //printk(KERN_ALERT "uni=0x%x\n",uni_ch);

    vga_putchar_ascii(' ',y,x,color);
    vga_putchar_ascii(' ',y,x + 1,color);
    OUT32(y | (x << 8),VGAADDR_BITCHARPOS);
    for(i=0; i < 8; i++)
        OUT32(ptr[i],VGAADDR_BITCHAR);
}

static void vga_crlf(void){    //光标换行
    text_y++;
    text_x=0;
    if(text_y == CONSOLE_HEIGHT){
        int i,j;
        text_y--;
        for(i=0; i < CONSOLE_HEIGHT - 1; i++)
            for(j=0; j < CONSOLE_WIDTH; j++){
                buf_ch[i][j]=buf_ch[i + 1][j];
                buf_color[i][j]=buf_color[i + 1][j];
                if(!buf_ch[i][j])
                    continue;
                if(buf_ch[i][j] & 0xFF00)
                    vga_putchar_unicode(buf_ch[i][j],i,j,buf_color[i][j]);
                else
                    vga_putchar_ascii(buf_ch[i][j],i,j,buf_color[i][j]);
            }
        for(j=0; j < CONSOLE_WIDTH; j++){
            buf_ch[CONSOLE_HEIGHT - 1][j]=' ';
            buf_color[CONSOLE_HEIGHT - 1][j]=DEFAULT_COLOR;
            vga_putchar_ascii(' ',CONSOLE_HEIGHT - 1,j,DEFAULT_COLOR);
        }
    }
    vga_setcursor(text_y,text_x);
}

static int putchar_uni_flag=0;
static unsigned int last_byte;


static void vga_putchar(unsigned char ch,unsigned char color){  //输出指向的ascii/gbk，自动移动光标
    if(!(text_x >= 0 && text_x < CONSOLE_WIDTH && text_y >= 0 && text_y < CONSOLE_HEIGHT)){
		text_x=0; text_y=0;
	}


    if(putchar_uni_flag){
        buf_ch[text_y][text_x]=(((unsigned int)ch) << 8) | last_byte;
        buf_ch[text_y][text_x + 1]=0;
        buf_color[text_y][text_x]=color | 0x80;
        buf_color[text_y][text_x + 1]=color;
        vga_putchar_unicode(buf_ch[text_y][text_x],text_y,text_x,color);
        putchar_uni_flag=0;
        text_x += 2;
    }else if(color & 0x80){
        last_byte=ch;
        putchar_uni_flag=1;
    }else if(ch >= ' '){
        vga_putchar_ascii(ch,text_y,text_x,color);
        buf_ch[text_y][text_x]=ch;
        buf_color[text_y][text_x]=color;
        text_x++;
    }else if(ch == '\n'){
        vga_crlf();
    }else if(ch == 0x08){
        if(text_x){
            text_x--;
            buf_ch[text_y][text_x]=' ';
            buf_color[text_y][text_x]=DEFAULT_COLOR;
            vga_putchar_ascii(' ',text_y,text_x,DEFAULT_COLOR);
        }
    }else if(ch == 0x09){
        if(text_x < CONSOLE_WIDTH - 8){
            buf_ch[text_y][text_x]=' ';
            buf_color[text_y][text_x]=DEFAULT_COLOR;
            vga_putchar_ascii(' ',text_y,text_x,DEFAULT_COLOR);
            text_x++;
            while(text_x & 7){
                buf_ch[text_y][text_x]=' ';
                buf_color[text_y][text_x]=DEFAULT_COLOR;
                vga_putchar_ascii(' ',text_y,text_x,DEFAULT_COLOR),text_x++;
            }
        }
    }
    vga_setcursor(text_y,text_x);

}

static void vga_disable(void){ //禁用VGA显示（屏幕全黑）
    OUT32(1,VGAADDR_DISABLE);
}

static void vga_enable(void){  //启用VGA显示
    OUT32(0,VGAADDR_DISABLE);
}

static unsigned char color_cast(unsigned char attr){
    //reverse attr byte?
    //注意：attr最高位为1时表示这是一个小端unicode的低字节
    //我们在转换后的属性字节仍然设为最高位
    return ((attr & 0x07) << 4) | ((attr >> 4) & 0x07) | (attr & 0x80);
}

static void mrvgacon_putc(struct vc_data *vc, int c, int ypos, int xpos){ 
    text_x=xpos;
    text_y=ypos;
    vga_setcursor(text_y,text_x);
    vga_putchar(c & 0xFF,color_cast((c >> 8) & 0xFF));
}
static void mrvgacon_putcs(struct vc_data *vc, const unsigned short *s,
			   int count, int ypos, int xpos){ 
    int i;
    text_x=xpos;
    text_y=ypos;
    //putchar_uni_flag=0;
    vga_setcursor(text_y,text_x);
    for(i=0; i < count; i++)
        vga_putchar(s[i] & 0xFF,color_cast((s[i] >> 8) & 0xFF));

}
static int mrvgacon_blank(struct vc_data *vc, int blank, int mode_switch)
{

	return 0;
}

static const char *mrvgacon_startup(void)
{
    int i,j;
    vga_setmode(0);
    for(i=0; i < CONSOLE_HEIGHT; i++)
        for(j=0; j < CONSOLE_WIDTH; j++)
            vga_putchar_ascii(' ',i,j,DEFAULT_COLOR),
            buf_ch[i][j]=' ',
            buf_color[i][j]=DEFAULT_COLOR;
    for(i=CONSOLE_HEIGHT; i < CONSOLE_HEIGHT + 2; i++)
        for(j=0; j < CONSOLE_WIDTH; j++)
            vga_putchar_ascii(' ',i,j,DEFAULT_COLOR);
    text_x=0;
    text_y=0;
    vga_setcursor(text_y,text_x);
    vga_enable();

    for(i=0; i < 0x80; i++){
        memcpy(uni_font + (0x3100 | i) * 32, uni_font + (0xA800 | i) * 32, 32);
    }

    return "Ma-River VGA Console";
}

static struct vc_data* mrvgacon_vc=NULL;

struct vc_data* mrvgacon_getvc(void){
    return mrvgacon_vc;
}

static void mrvgacon_init(struct vc_data *vc, int init)
{

    printk(KERN_ALERT "Ma River VGA Console: Init\n");
    mrvgacon_vc=vc;
    vc->vc_can_do_color = 1;
    if (init) {
	vc->vc_cols = CONSOLE_WIDTH;
	vc->vc_rows = CONSOLE_HEIGHT;
    } else
	vc_resize(vc, CONSOLE_WIDTH, CONSOLE_HEIGHT);
    vc->vc_hi_font_mask=0x8000;
    vc->vc_utf=1;
}

static void mrvgacon_deinit(struct vc_data *vc){ 

}
static void mrvgacon_clear(struct vc_data *vc, int sy, int sx, int height,
			   int width){ 
    int i,j;
    for(i=0; i < height; i++)
        for(int j=0; j < width; j++){
            buf_ch[sy + i][sx + j]=' ';
            buf_color[sy + i][sx + j]=DEFAULT_COLOR;
            vga_putchar_ascii(' ',sy + i,sx + j,DEFAULT_COLOR);
        }
}
static void mrvgacon_cursor(struct vc_data *vc, int mode){ 
    text_x=vc->state.x;
    text_y=vc->state.y;
    vga_setcursor(text_y,text_x);
}
static bool mrvgacon_scroll(struct vc_data *vc, unsigned int top,
			    unsigned int bottom, enum con_scroll dir,
			    unsigned int lines)
{
    int i,j;
    if(bottom - top <= lines)
        return false;
    for(int i=top; i < bottom - lines; i++){
        for(j=0; j < CONSOLE_WIDTH; j++){
            buf_ch[i][j]=buf_ch[i + lines][j];
            buf_color[i][j]=buf_color[i + lines][j];
            if(!buf_ch[i][j])
                continue;
            if(buf_ch[i][j] & 0xFF00)
                vga_putchar_unicode(buf_ch[i][j],i,j,buf_color[i][j]);
            else
                vga_putchar_ascii(buf_ch[i][j],i,j,buf_color[i][j]);
        }
    }
    for(i=bottom - lines; i < bottom; i++){
        for(j=0; j < CONSOLE_WIDTH; j++){
            buf_ch[i][j]=' ';
            buf_color[i][j]=DEFAULT_COLOR;
            vga_putchar_ascii(' ',i,j,buf_color[i][j]);
        }
    }
    text_y -= lines;
    if(text_y < 0)
        text_y=0;
    vga_setcursor(text_y,text_x);

    //putchar_uni_flag=0;

	return false;
}
