//对外提供的接口
void mrvga_print(unsigned short* uni,unsigned char* colors,int x,int y,int length,int setcur,int blank,unsigned char blankcolor){
    int i;
    for(i=0; i < length; i++){
        if(uni[i] & 0xFF00){
            vga_putchar_unicode(uni[i],y,x,colors[i]);
            x += 2;
        }else{
            vga_putchar_ascii(uni[i] & 0xFF,y,x,colors[i]);
            x++;
        }
    }
    if(setcur)
        vga_setcursor(y,x);
    if(blank){
        for(i=x; i < CONSOLE_WIDTH; i++)
            vga_putchar_ascii(' ',y,i,blankcolor);
    }
}
void mrvga_restore_cur(void){
    vga_setcursor(text_y,text_x);
}



